import React from "react";
import "./UserItem.css";

function UserLtem(props) {
  return (
    <li className="user-item">
      <div className="user-item__content">
        <div className="user-item__image">
          <img src={props.image}></img>
        </div>
      </div>
    </li>
  );
}

export default UserLtem;
